import React from 'react';
import NavMenu from './NavMenu';
import '../Styles/General.css';
import 'bootstrap/dist/css/bootstrap.css';
import '../Styles/Collection.css';

function Collection() {
    return (
        <div className='Collection standard'>
            <h1>COLLECTION</h1>
            <hr />
            <h3 className='right-align'>Search</h3>
            <h3>Filter</h3>
            <h3>Sort</h3>

            <div className='inverse center'>
                <div className='row'>
                    <div className='col-6 standard'>
                        <img src= {require ('../Images/sampleimage.jpg')} />
                    </div>
                    <div className='col-6 standard'>
                    <img src= {require ('../Images/sampleimage.jpg')} />
                    </div>
                </div>

                <div className='col-6'>
                    <h5 className='inline'>Title</h5>
                    <p className='inline right-align'>DD-MM-YYYY</p>
                    <h5>Artist</h5>
                </div>
                
            </div>
        </div>
    );
}

export default Collection;
